import React from 'react'

function RoleAssignments() {
    const user = JSON.parse(localStorage.getItem("user"))

  return (
    <div className='container'>
        <div className='row'>
            <div className='col border'>
                {user.developers?.map(d => {
                    return(
                        <li>{d.username}</li>
                    )
                })}
            </div>
        </div>
    </div>
  )
}

export default RoleAssignments
